import React from "react";
import ReactDOM from 'react-dom'
import Copy from "./copy";

function urlCopy(){
    return(
        <div className="copy">
            <Copy/>
        </div>
    )
}


document.addEventListener('DOMContentLoaded', () => {
    ReactDOM.render(
      <urlCopy/>,
      document.getElementById('copy')
    )
    })
